import React from 'react'
import Header from './common/Header'
import Footer from './common/Footer'

const Layout = (props) => {
  const {children, title} = props;
  return (
    <>
      <Header title={title}/>
        {children}
      <Footer/>
    </>
  )
}
export default Layout;
